pragma solidity ^0.4.18;
import "../node_modules/zeppelin-solidity/contracts/ownership/Ownable.sol";
import "../node_modules/zeppelin-solidity/contracts/crowdsale/Crowdsale.sol";
import "../node_modules/zeppelin-solidity/contracts/token/ERC20/MintableToken.sol";
import "./BlockchainLabsToken.sol";

/**
 * @title BlockchainLabsCrowdsale
 * @dev BlockchainLabsCrowdsale is a base contract for managing a token crowdsale inheriting from zeppeline.
 * BlockchainLabsCrowdsale have a start and end timestamps, where investors can make
 * token purchases and the crowdsale will assign them tokens based
 * on a token per ETH rate. Funds collected are forwarded to a wallet
 * as they arrive.
 */
contract BlockchainLabsCrowdsale is Ownable, Crowdsale {

  function BlockchainLabsCrowdsale(uint256 _startTime, uint256 _endTime, uint256 _rate, address _wallet) public 
    Crowdsale(_startTime, _endTime, _rate, _wallet) 
  {

  }

  // creates the token to be sold.
  // override this method to have crowdsale of a specific mintable token.
  function createTokenContract() internal returns (MintableToken) {
    return new BlockchainLabsToken();
  }
}

